import React from "react";
import PropTypes from "prop-types";
import "./style.scss";

Addpoll.propTypes = {};

function Addpoll(props) {
  return (
    <div className="add">
      <input placeholder="Poll Content" className="add__input"></input>
      <button className="add__btn">Add new</button>
    </div>
  );
}

export default Addpoll;
